-- ----------------------------
-- Table structure for Engagement
-- ----------------------------
DROP TABLE IF EXISTS `Engagement`;
CREATE TABLE `Engagement`  (
  `Id` int(11) NOT NULL COMMENT 'ID',
  `StoryId` int(11) NOT NULL COMMENT '关联的story表里的主键',
  `RoleId` int(11) NOT NULL COMMENT '关联的角色id',
  `Type` int(11) NOT NULL COMMENT '约会类型： 1常驻  2场景  3支线',
  `Cost` int(11) NOT NULL COMMENT '消耗的体力数',
  `Reward` int(11) NOT NULL COMMENT '结算奖励填奖励组id',
  `FrontId` int(11) NOT NULL COMMENT '前置约会id，0代表没有前置（已废弃）',
  `MainStageId` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '必要开启条件(需同时满足该字段配置的所有条件)',
  `Limit` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '满足MainStageId条件后，满足任一该字段所填条件\r\n1：关卡解锁，1_关卡id\n\r\n2：好感度等级，2_好感度等级\n\r\n3：服装星级，3_时装id_时装星级，时装星级可以填0，代表获取就解锁\n\r\n4：女主等级，4_女主等级\n\r\n5：约会解锁，5_约会id\r\n\n6：关卡进入就解锁（不用完成）6_关卡ID\r\n\n7：约会进入就解锁（不用完成）7_约会id\n\r\n8:获得时装 8_时装id\r\n这个字段可以配置多个条件，多个条件用|隔开',
  PRIMARY KEY (`Id`) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci ROW_FORMAT = Compact;

-- ----------------------------
-- Records of Engagement
-- ----------------------------

