-- ----------------------------
-- Table structure for StageData
-- ----------------------------
DROP TABLE IF EXISTS `StageData`;
CREATE TABLE `StageData`  (
  `Id` int(11) NOT NULL COMMENT '作者:\r\n1-10000：普通本\r\n10001-2W ： 精英本\r\n20001以上 ： 随机本',
  `Cost` int(11) NOT NULL COMMENT '消耗的体力值',
  `Diffculty` int(11) NOT NULL COMMENT '1普通\r\n2精英',
  `Type` int(11) NOT NULL COMMENT '作者:\r\n0：普通战斗关\r\n1：剧情关\r\n2：随机副本 3:剧情+战斗',
  `StoryId` int(11) NOT NULL COMMENT '关联Story表的ID',
  `Chapter` int(11) NOT NULL COMMENT '章节数',
  `LimitRoleId` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '作者:\r\n强制要求上场的角色id，多个用|隔开\r\n不配置默认女主强制上',
  `Exp` int(11) NOT NULL COMMENT '战斗获取的经验\r\n非扫荡的战斗：全队出站的角色都获得经验\r\n扫荡：只有女主获得经验',
  `Coin` int(11) NOT NULL COMMENT '获得的金币',
  `StoryDrop` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '剧情掉落',
  `FirstDrop` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '首次通关时的掉落',
  `NormalDrop` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '非首次通关，常规通关时的掉落',
  `SweapDrop` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '扫荡额外掉落',
  `LevelLimit` int(11) NOT NULL COMMENT '限制等级',
  `DailyLimit` int(11) NOT NULL COMMENT '每日限制次数',
  `Round` int(11) NOT NULL COMMENT '波数',
  `ATType` int(11) NOT NULL COMMENT '作者:\r\n关联AT奖励表里的type',
  `NpcSet` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT 'Npc集合配置',
  `FrontId` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '前置关卡id集合',
  `BranchConfig` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '分歧点配置',
  `WinCondition` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '胜利条件',
  `StarCondition` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '三星条件集合',
  `Position` int(11) NOT NULL COMMENT '作者:\r\n随机副本的位置标识',
  `Weight` int(11) NOT NULL COMMENT '作者:\r\n随机副本的刷新权重\r\n将同章的分权重加起来作为总权重',
  `DateUnLockRole` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '初见角色id',
  `FightUnlockRole` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '入队角色id',
  `AssistRole` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '助战角色id',
  `FishingSpaceUnlock` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '解锁渔场id',
  PRIMARY KEY (`Id`) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci ROW_FORMAT = Compact;

-- ----------------------------
-- Records of StageData
-- ----------------------------

