-- ----------------------------
-- Table structure for WeChatMessage
-- ----------------------------
DROP TABLE IF EXISTS `WeChatMessage`;
CREATE TABLE `WeChatMessage`  (
  `Id` int(11) NOT NULL COMMENT 'ID',
  `ListId` int(11) NOT NULL COMMENT '通讯录id',
  `StoryId` int(11) NOT NULL COMMENT '关联剧情id',
  `Type` int(11) NOT NULL COMMENT '类型:1单人电话  2讨论组  3公众号  4声音',
  `FrontId` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '条件，格式与Limit相同，多个条件用&隔开，表示多条件同时满足',
  `Time` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '时间',
  `Limit` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '开启条件集合\r\n作者:\r\n1：关卡解锁，1_关卡id\r\n2：好感度等级，2_角色id_好感度等级\r\n3：服装星级，3_时装id_时装星级，时装星级可以填0，代表获取就解锁\r\n4：女主等级，4_女主等级\r\n5：约会解锁，5_约会id\r\n6：关卡进入就解锁（不用完成）6_关卡ID\r\n7：约会进入就解锁（不用完成）7_约会id\r\n8:获得时装 8_时装id\r\n9：关卡节点， 9_关卡ID_唯一节点ID\r\n10.日常副本首次完成  10_日常副本id\r\n11: 完成通讯器短信  11_通讯器短信id\r\n12:完成通讯器电话 12_通讯器电话id\r\n13: 看过通讯器公众号 13_通讯器公众号id\r\n14:完成通讯器短信并选择了特定节点 14_通讯器短信id_唯一节点id\r\n15:完成通讯器电话并选择了特定节点 15_通讯器电话id_唯一节点id\r\n\r\n这个字段可以配置多个条件，多个条件用|隔开\r\n\r\n默认解锁的对话填空，保证解锁后有至少一段对话',
  PRIMARY KEY (`Id`) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci ROW_FORMAT = Compact;

-- ----------------------------
-- Records of WeChatMessage
-- ----------------------------

